import styles from "./Nav.module.scss";
import { Link } from "react-router-dom";
import { useState } from "react";

function Nav() {
  return (
    <header>
      <Link to={"/main"}>Justgram</Link>
      <input placeholder="검색" />
      <div>
        <img src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/bearu/explore.png" alt="1"/>
        <img src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/bearu/heart.png" alt="2" />
        <img src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/bearu/profile.png" alt="3" />
      </div>
    </header>
  );
}
export default Nav;
